(13, 'Mango', 'mango', 'A mango is a juicy stone fruit produced from numerous species of tropical trees belonging to the flowering plant genus Mangifera, cultivated mostly for their edible fruit. Most of these species are found in nature as wild mangoes. The genus belongs to the cashew family Anacardiaceae.', 1, 2.5, 6, NULL, 'en', 2.50, 2.50, '13', 50, 0, 1, 0, 1, NULL, 'publish', 'simple', '1lb', NULL, NULL, NULL, '{\"id\": \"14\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/14/Mangoes.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/14/conversions/Mangoes-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-03-08 10:54:24', '2023-10-16 06:54:29', NULL, NULL, 0, 0, NULL, NULL, NULL),
