(547, 'Root of Bomax 1 lbs', 'root-of-bomax-1-lbs', 'Bombax, like other trees of the genus Bombax, is commonly known as cotton tree. More specifically, it is sometimes known as Malabar silk-cotton tree; red silk-cotton; red cotton tree; or ambiguously as silk-cotton or kapok, both of which may also refer to Ceiba pentandra.\n\nThis Asian tropical tree has a straight tall trunk and its leaves are deciduous in winter. Red flowers with 5 petals appear in the spring before the new foliage. It produces a capsule which, when ripe, contains white fibres like cotton. Its trunk bears spikes to deter attacks by animals. Although its stout trunk suggests that it is useful for timber, its wood is too soft to be very useful.', 7, 3.29, 6, 2.49, 'en', 3.29, 3.29, '568513688351', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '1lbs', NULL, NULL, NULL, '{\"id\": 993, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/993/Root5.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/993/conversions/Root5-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 10:24:24', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
