(550, 'Organic Sweet Potato 1lbs', 'organic-sweet-potato-1lbs', 'The sweet potato or sweetpotato is a dicotyledonous plant that belongs to the bindweed or morning glory family, Convolvulaceae. Its large, starchy, sweet-tasting, tuberous roots are used as a root vegetable. The young shoots and leaves are sometimes eaten as greens.', 7, 2.99, 6, NULL, 'en', 2.99, 2.99, '124578963254', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '1lbs', NULL, NULL, NULL, '{\"id\": 997, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/997/Root8.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/997/conversions/Root8-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 10:37:44', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(551, 'Organic Cassava 1lbs', 'organic-cassava-1lbs', 'The cassava is a very useful and important plant in places like South America, Indonesia, and especially in Africa, where my distant basenji cousins live.  When it grows, it makes a bunch of tuber-type roots under the ground, sort of like potatoes.  This is the part of the plant that is eaten the most, but you can also eat the cassava leaves or feed them to your cattle and goats.', 7, 2.49, 6, NULL, 'en', 2.49, 2.49, '245789635784', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '1lbs', NULL, NULL, NULL, '{\"id\": 999, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/999/Root6.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/999/conversions/Root6-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 10:42:42', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(552, 'Wild Yam 1lbs', 'wild-yam-1lbs', 'Wild Yam is one of a thousand of herbs out there that can benefit your horse, but each herb, despite having similar capabilities regarding inflammation, can be quite different in their overall mechanism of action.  Thus, no one herb is right or beneficial for each and every horse.  Wild Yam is one that is quite unique and an herb that I have found to have tremendous value in the right horse for a variety of reasons and issues.', 7, 2, 6, NULL, 'en', 2.00, 2.00, '569874125478', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '1lbs', NULL, NULL, NULL, '{\"id\": 1000, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1000/Root7.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1000/conversions/Root7-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 11:20:16', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(553, 'Cucumber', 'cucumber-2', 'Cucumber is a widely cultivated plant in the gourd family, Cucurbitaceae. It is a creeping vine that bears cucumiform fruits that are used as vegetables. There are three main varieties of cucumber: slicing, pickling, and seedless. Within these varieties, several cultivars have been created.', 7, 2.59, 6, NULL, 'en', 2.59, 2.59, '568741239654', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '2 lbs', NULL, NULL, NULL, '{\"id\": 1001, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1001/Marrow1.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1001/conversions/Marrow1-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 11:22:40', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(554, 'Ash Gourd 2lbs', 'ash-gourd-2lbs', 'Ash gourd, scientifically termed Benincasa hispida, goes by several vernacular names such as “Petha” in Hindi, “Boodida Gummadi” in Telugu, “Neer Pooshnikkai” in Tamil and “Kumbalam” in Malayalam.\n\nThis green vegetable has been well-regarded for its significant medicinal values since ancient times and is widely documented in Ayurvedic texts. Today, it continues to be heralded for its immense health benefits and is widely incorporated, in popular local cuisine across India, as well as in alleviating illnesses of the stomach, liver and skin, to name a few.', 7, 3.1, 6, 2.69, 'en', 3.10, 3.10, '256897412365', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '2lbs', NULL, NULL, NULL, '{\"id\": 1002, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1002/Marrow2.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1002/conversions/Marrow2-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 11:26:10', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(555, 'Cherry Tomato 1lbs', 'cherry-tomato-1lbs', 'Tomatoes are loaded with a substance called lycopene. It gives them their bright red color and helps protect them from the ultraviolet rays of the sun. In much the same way, it can help protect your cells from damage. Tomatoes also have potassium, vitamins B and E, and other nutrients.', 7, 2, 6, NULL, 'en', 2.00, 2.00, '564134569785', 49, 0, 1, 0, 0, NULL, 'publish', 'simple', '1lbs', NULL, NULL, NULL, '{\"id\": 1003, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1003/Marrow3.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1003/conversions/Marrow3-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 11:30:05', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(556, 'Red Capsicum 1lbs', 'red-capsicum-1lbs', 'A wonderful combination of tangy taste and crunchy texture, sweet Capsicum are the ornaments of the vegetable world with their beautifully shaped glossy exterior that comes in a wide array of vivid colors ranging from red. Capsicum is not only an excellent source of carotenoids, but also a source of over 30 different members of the carotenoid nutrient family.It also contains vitamin C and E.', 7, 4.59, 6, 3, 'en', 4.59, 4.59, '265478954752', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '1 lbs', NULL, NULL, NULL, '{\"id\": 1004, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1004/Marrow4.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1004/conversions/Marrow4-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 11:31:58', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(557, 'Green Capsicum 1lbs', 'green-capsicum-1lbs', 'Green capsicums are picked when ripe and have an all-over green appearance.A fresh, crisp green capsicum is a tasty vegetable that can be a regular part of your healthy eating plan. This vegetable is low in calories and contains 0 grams of fat and a good supply vitamins and minerals. Their mildly sweet flavor makes green bell peppers versatile enough to include a wide variety of nutritious recipes.', 7, 3.49, 6, NULL, 'en', 3.49, 3.49, '256987412365', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '1lbs', NULL, NULL, NULL, '{\"id\": 1005, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1005/Marrow5.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1005/conversions/Marrow5-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 11:34:19', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(558, 'Collard Greens 2lbs', 'collard-greens-2lbs', 'The dark, vibrant green leaves of collard greens are packed with vitamins, minerals and soluble fiber. They’re also extremely satisfying to cook with, and lend themselves well to olive oil braising, soups, and slow cooking. A hardy green with a mildly cabbagy flavor, collards stand up well to longer cooking times, which softens the texture and mellows the flavor. They pair deliciously with assertive flavors, such as smokiness or meatiness (pancetta, bacon, chorizo, kielbasa, any cured meat), sweetly pungent aromatics (garlic, onions, fresh ginger,) an acid or anything spicy (vinegar, lemon juice, hot sauce, red pepper flakes, chile or curry paste, minced hot peppers) or anything creamy (think heavy cream, sour cream, and goat cheese.)', 7, 1.99, 6, NULL, 'en', 1.99, 1.99, '256547896541', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '2 lbs', NULL, NULL, NULL, '{\"id\": 1006, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1006/Leafy_green1.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1006/conversions/Leafy_green1-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 11:41:23', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(559, 'Coriander Bunch 250 g', 'coriander-bunch-250-g', 'If you are into dressing your food well, Coriander must top your grocery list. Coriander not just make the food look appealing but also adds a distinct flavour to the food. It is widely used for preparations of sides, chutneys and sauces too. Buy Coriander Bunch (Approx 50 g - 200 g) online now.', 7, 1.49, 6, NULL, 'en', 1.49, 1.49, '569874521458', 49, 0, 1, 0, 0, NULL, 'publish', 'simple', '250 g', NULL, NULL, NULL, '{\"id\": 1007, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1007/Leafy_green2.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1007/conversions/Leafy_green2-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 11:43:06', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(560, 'Parsley 1lbs', 'parsley-1lbs', 'Fresh, slightly spicy and above all very healthy: parsley is one of the classic herbs in the kitchen. No soup, sauce or pasta without parsley, whose full flavour with a hint of pepper is always recognisable. What many don\'t know is that this fresh herb is packed with vitamins and minerals, such as vitamin K, which assists the body in absorbing calcium.', 7, 2.29, 6, NULL, 'en', 2.29, 2.29, '598741256321', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '1lbs', NULL, NULL, NULL, '{\"id\": 1008, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1008/Leafy_green3.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1008/conversions/Leafy_green3-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 11:48:57', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(561, 'Spinach 2lbs', 'spinach-2lbs', 'Spinach is a leafy green flowering plant native to central and western Asia. It is of the order Caryophyllales, family Amaranthaceae, subfamily Chenopodioideae. Its leaves are a common edible vegetable consumed either fresh, or after storage using preservation techniques by canning, freezing, or dehydration.', 7, 3.59, 6, 2.99, 'en', 3.59, 3.59, '213698745214', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '2lbs', NULL, NULL, NULL, '{\"id\": 1009, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1009/Leafy_green4.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1009/conversions/Leafy_green4-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 11:52:08', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(562, 'Green Chard 2lbs', 'green-chard-2lbs', 'Chard or Swiss chard is a green leafy vegetable. In the cultivars of the Flavescens Group, the leaf stalks are large and often prepared separately from the leaf blade; the Cicla Group is the leafy spinach beet.', 7, 3.49, 6, NULL, 'en', 3.49, 3.49, '546987452365', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '2lbs', NULL, NULL, NULL, '{\"id\": 1010, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1010/Leafy_green5.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1010/conversions/Leafy_green5-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 11:54:24', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(563, 'Malabar Spinach 2lbs', 'malabar-spinach-2lbs', 'Basella alba is an edible perennial vine in the family Basellaceae. It is found in tropical Asia and Africa where it is widely used as a leaf vegetable. It is native to the Indian subcontinent, Southeast Asia and New Guinea.', 7, 3.99, 6, 3, 'en', 3.99, 3.99, '258963147852', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '2 lbs', NULL, NULL, NULL, '{\"id\": 1011, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1011/Leafy_green6.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1011/conversions/Leafy_green6-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 11:57:13', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(564, 'Green Organic Mint leaves 1lbs', 'green-organic-mint-leaves-1lbs', 'Peppermint (Mentha piperita), strongly aromatic perennial herb of the mint family. The mint leaves tastes cool. It is widely cultivated in many regions of the world ; born wet in the water, the elevation can be as high as 3,500 meters.Peppermint can consist of fresh or dry leaves for use in food or as a tea. It is also used to make dishes or desserts to remove the smell of fish and mutton.', 7, 3.55, 6, 2.99, 'en', 3.55, 3.55, '256987412563', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '1lbs', NULL, NULL, NULL, '{\"id\": 1012, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1012/Leafy_green7.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1012/conversions/Leafy_green7-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 12:01:06', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(565, 'Spinach Leaves 2lbs', 'spinach-leaves-2lbs', 'Fresh vegetables have a specific color, firmness and smell. … Some seasonally available vegetables are: January – June: onions, potatoes, asparagus, greens, lettuce, peas, radishes, spinach and turnips.', 7, 4.88, 6, 2, 'en', 4.88, 4.88, '523698741256', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '2lbs', NULL, NULL, NULL, '{\"id\": 1013, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1013/Leafy_green8.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1013/conversions/Leafy_green8-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 12:05:43', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(566, 'Fresh arugula leaves 2lbs', 'fresh-arugula-leaves-2lbs', 'Fresh arugula leaves have a distinctive spicy kick that will turn up the flavors in your salads, pastas, sandwiches, and sauces. The flavor can be bright, tart, peppery, and slightly bitter, depending on its maturity. You\'ll find that baby arugula is delicate and mild, while mature arugula is much spicier.', 7, 3.88, 6, 2.99, 'en', 3.88, 3.88, '256398741254', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '2 lbs', NULL, NULL, NULL, '{\"id\": 1014, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1014/Leafy_green9.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1014/conversions/Leafy_green9-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 12:09:15', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(567, 'Organic Baby Spinach 1lbs', 'organic-baby-spinach-1lbs', 'Fresh vegetables have a specific color, firmness and smell. … Some seasonally available vegetables are: January – June: onions, potatoes, asparagus, greens, lettuce, peas, radishes, spinach and turnips.', 7, 4.26, 6, 3.26, 'en', 4.26, 4.26, '569874125632', 49, 0, 1, 0, 0, NULL, 'publish', 'simple', '1lbs', NULL, NULL, NULL, '{\"id\": 1015, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1015/Leafy_green10.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1015/conversions/Leafy_green10-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 12:11:05', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(568, 'Garden asparagus 2lbs', 'garden-asparagus-2lbs', 'Garden asparagus, folk name sparrow grass, scientific name Asparagus officinalis, is a perennial flowering plant species in the genus Asparagus. Its young shoots are used as a spring vegetable. It was once classified in the lily family, like the related Allium species, onions and garlic.', 7, 3.89, 6, 3.29, 'en', 3.89, 3.89, '6352114578963', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '2 lbs', NULL, NULL, NULL, '{\"id\": 1016, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1016/Edible-plant1.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1016/conversions/Edible-plant1-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 12:13:05', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(569, 'Small asparagus 2lbs', 'small-asparagus-2lbs', 'Asparagus are the young shoots form a lily plant. It is rich in dietary nutrients; such as vitamin B6, calcium and zinc and it is also a great source of dietary fibre. The product is more tinder compare to average asparagus sold on the market.', 7, 2.99, 6, NULL, 'en', 2.99, 2.99, '236541478963', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '2lbs', NULL, NULL, NULL, '{\"id\": 1017, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1017/Edible-plant2.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1017/conversions/Edible-plant2-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 12:15:38', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(570, 'Green Kohlrabi 2lbs', 'green-kohlrabi-2lbs', 'Organic Kohlrabi is an annual vegetable popular in north parts of India. Eaten both raw or in cooked state. The root, leaves are also used as they contain significant nutrients. Few health benefits include: improves digestion, improves vision and combats cancer. Available at Green Station.', 7, 3.25, 6, 2.59, 'en', 3.25, 3.25, '635241475869', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '2lbs', NULL, NULL, NULL, '{\"id\": 1018, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1018/Edible-plant3.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1018/conversions/Edible-plant3-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 12:18:16', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(571, 'Bamboo Shoot 1lbs', 'bamboo-shoot-1lbs', 'We know spring is here when fresh bamboo shoots start popping up from the ground. In keeping with the traditional Japanese concept of enjoying food during its peak season, why not try this tasty and easy version of bamboo rice to celebrate spring, the season of renewal.', 7, 3.29, 6, 2.89, 'en', 3.29, 3.29, '635241456321', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '1lbs', NULL, NULL, NULL, '{\"id\": 1019, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1019/Edible-plant4.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1019/conversions/Edible-plant4-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 12:20:29', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(572, 'Fresh Rhubarb 2lbs', 'fresh-rhubarb-2lbs', 'Rhubarb is a perennial vegetable (yes, vegetable) characterized by long crimson or light green stalks topped by large ruffled green leaves. Although the Chinese have used rhubarb medicinally for thousands of years, its use as a food source is a relatively recent development, particularly after the 17th century when sugar became more widely available and it became a popular addition to pies and other desserts. Today, it\'s commonly paired with strawberries or other sweet fruits to balance out its tart flavor.', 7, 3.26, 6, NULL, 'en', 3.26, 3.26, '523641789654', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '2lbs', NULL, NULL, NULL, '{\"id\": 1020, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1020/Edible-plant5.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1020/conversions/Edible-plant5-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 12:24:49', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
