(574, 'Fresh Celery 2lbs', 'fresh-celery-2lbs', 'Celery is a marshland plant in the family Apiaceae that has been cultivated as a vegetable since antiquity. Celery has a long fibrous stalk tapering into leaves. Depending on location and cultivar, either its stalks, leaves or hypocotyl are eaten and used in cooking.', 7, 2.99, 6, NULL, 'en', 2.99, 2.99, '632587412563', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '2lbs', NULL, NULL, NULL, '{\"id\": 1022, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1022/Edible-plant7.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1022/conversions/Edible-plant7-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 12:27:58', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
