(831, 'Squid Fish', 'squid-fish', 'Squid are cephalopods in the superorder Decapodiformes with elongated bodies, large eyes, eight arms and two tentacles. ... Squid diverged from other cephalopods during the Jurassic and occupy a similar role to teleost fish as open water predators of similar size and behaviour.', 7, 11.88, 6, 10.99, 'en', 11.88, 11.88, '256321458974', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '2 lbs', NULL, NULL, NULL, '{\"id\": 1283, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1283/Shellfish1.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1283/conversions/Shellfish1-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-10-02 18:15:17', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(832, 'Octopus Tentacles', 'octopus-tentacles', '100 grams of Octopus have approximately 29 grams of protein! It is also a perfect source of vitamin B6 and B12, selenium and iron. Here is Italian’s favourite recipe: Octopus and Potato Salad! Boil octopus in a large pot for 30 minutes. In another pot, boil whole and unpeeled potatoes for 20 minutes. Peel the potatoes, cut into cubes. Once the octopus tentacles are cooked, cut them into chunks. Toss the octopus and potatoes together with the chopped parsley, lemon juice, olive oil, and olive slices. Spice with salt and pepper', 7, 15.3, 6, NULL, 'en', 15.30, 15.30, '256321458965', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '2lbs', NULL, NULL, NULL, '{\"id\": 1284, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1284/Shellfish2.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1284/conversions/Shellfish2-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-10-02 18:18:35', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(833, 'Crayfish', 'crayfish', 'Crayfish are freshwater crustaceans resembling small lobsters. In some locations, they are also known as crawfish, craydids, crawdaddies, crawdads, freshwater lobsters, mountain lobsters, rock lobsters, mudbugs, or yabbies. Taxonomically, they are members of the superfamilies Astacoidea and Parastacoidea.', 7, 14.29, 6, 12.3, 'en', 14.29, 14.29, '256987541256', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '2lbs', NULL, NULL, NULL, '{\"id\": 1285, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1285/Shellfish3.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1285/conversions/Shellfish3-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-10-02 18:20:07', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(834, 'Black Oyster', 'black-oyster', 'The black oyster mushroom (Shimofuri), also known as the black oyster, black king trumpet, or the black pearl is a unique hybrid that starting to gain notoriety. You\'ve probably heard about oyster mushrooms by now. ... This mushroom was developed by crossbreeding European oyster mushrooms with Japanese oyster mushrooms.', 7, 20.29, 6, 18.99, 'en', 20.29, 20.29, '256321457896', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '2lbs', NULL, NULL, NULL, '{\"id\": 1286, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1286/Shellfish4.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1286/conversions/Shellfish4-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-10-02 18:22:08', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(835, 'lams', 'lams', 'Clam is a common name for several kinds of bivalve molluscs. The word is often applied only to those that are edible and live as infauna, spending most of their lives halfway buried in the sand of the seafloor or riverbeds.', 7, 14.22, 6, NULL, 'en', 14.22, 14.22, '259687541256', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '2lbs', NULL, NULL, NULL, '{\"id\": 1287, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1287/Shellfish5.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1287/conversions/Shellfish5-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-10-02 18:23:56', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(836, 'Tuna Fish', 'tuna-fish', 'A tuna is a saltwater fish that belongs to the tribe Thunnini, a subgrouping of the Scombridae family. The Thunnini comprise 15 species across five genera, the sizes of which vary greatly, ranging from the bullet tuna up to the Atlantic bluefin tuna.', 7, 14.29, 6, NULL, 'en', 14.29, 14.29, '256321457896', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '2lbs', NULL, NULL, NULL, '{\"id\": 1288, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1288/Sea-Fish1.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1288/conversions/Sea-Fish1-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-10-02 18:49:03', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(837, 'Bacalao Fish', 'bacalao-fish', 'Bacalao, salted dried codfish, is the defining ingredient in traditional Puerto Rican fish stew, but salt cod requires overnight soaking and several rinses in cool water before it can be used, so we opt for fresh fish in this quick version.', 7, 20.99, 6, 18.99, 'en', 20.99, 20.99, '125698745214', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '5lbs', NULL, NULL, NULL, '{\"id\": 1289, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1289/Sea-Fish2.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1289/conversions/Sea-Fish2-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-10-02 18:50:36', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(838, 'Salmon Fish', 'salmon-fish', 'The Atlantic salmon is a species of ray-finned fish in the family Salmonidae. It is the 3rd largest of the Salmonidae and can grow up to a meter in length. Siberian Taimen, and Pacific Chinook Salmon can be larger, with Taimen reportedly able to grow to 6 ft long.', 7, 16.88, 6, NULL, 'en', 16.88, 16.88, '256321457989', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '5lbs', NULL, NULL, NULL, '{\"id\": 1290, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1290/Sea-Fish3.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1290/conversions/Sea-Fish3-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-10-02 18:52:25', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(839, 'Sea bass fish', 'sea-bass-fish', 'Sea bass, (family Serranidae), any of the numerous fishes of the family Serranidae (order Perciformes), most of which are marine, found in the shallower regions of warm and tropical seas. The family includes about 475 species, many of them well-known food and sport fishes.', 7, 15.99, 6, 13.29, 'en', 15.99, 15.99, '256321457896', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '4lbs', NULL, NULL, NULL, '{\"id\": 1291, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1291/Sea-Fish4.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1291/conversions/Sea-Fish4-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-10-02 18:53:57', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(840, 'Mackerel Fish', 'mackerel-fish', 'Mackerel is a common name applied to a number of different species of pelagic fish, mostly from the family Scombridae. They are found in both temperate and tropical seas, mostly living along the coast or offshore in the oceanic environment.', 7, 11.29, 6, NULL, 'en', 11.29, 11.29, '253698547412', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '3lbs', NULL, NULL, NULL, '{\"id\": 1292, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1292/Sea-Fish5.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1292/conversions/Sea-Fish5-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-10-02 18:55:08', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(841, 'Sea Bream', 'sea-bream', 'The gilt-head bream, called Orata in antiquity and still today in Italy, is a fish of the bream family Sparidae found in the Mediterranean Sea and the eastern coastal regions of the North Atlantic Ocean. It commonly reaches about 35 centimetres in length, but may reach 70 cm and weigh up to about 7.36 kilograms.', 7, 18.59, 6, 16.99, 'en', 18.59, 18.59, '256321457896', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '5 lbs', NULL, NULL, NULL, '{\"id\": 1293, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1293/Sea-Fish6.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1293/conversions/Sea-Fish6-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-10-02 19:02:19', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(842, 'Pollock Fish', 'pollock-fish', 'Pollock or pollack is the common name used for either of the two species of North Atlantic marine fish in the genus Pollachius. Pollachius pollachius is referred to as pollock in both North America and the United Kingdom, while Pollachius virens is usually known as coley in Great Britain and Ireland.', 7, 17.49, 6, NULL, 'en', 17.49, 17.49, '256321458796', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '6 lbs', NULL, NULL, NULL, '{\"id\": 1294, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1294/Sea-Fish7.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1294/conversions/Sea-Fish7-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-10-02 19:04:03', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(843, 'Halibut Fish', 'halibut-fish', 'Halibut is the common name for three flatfish in the genera Hippoglossus and Reinhardtius from the family of right-eye flounders and, in some regions, and less commonly, other species of large flatfish. The word is derived from haly and butte, for its popularity on Catholic holy days.', 7, 18.99, 6, 16.49, 'en', 18.99, 18.99, '256321458965', 50, 0, 1, 0, 0, NULL, 'publish', 'simple', '6 lbs', NULL, NULL, NULL, '{\"id\": 1295, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1295/Sea-Fish8.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1295/conversions/Sea-Fish8-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-10-02 19:06:15', '2023-10-06 06:19:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
