(950, 'Razero Wolverine', 'razero-wolverine', 'Introducing the Razero Wolverine: Master Your Gaming Performance\n\nUnleash your gaming potential with the Razero Wolverine controller series. Designed for both Xbox and PC gaming, the Razero Wolverine offers a personalized gaming experience like no other. With advanced features, ergonomic design, and customizable controls, this controller elevates your gameplay to new heights.\n\nKey Features:\n\n1. Customizable Precision: The Razero Wolverine empowers you with extra programmable buttons and triggers that can be remapped to match your playstyle and gain the upper hand in every game.\n\n2. Ergonomic Excellence: Crafted with comfort in mind, the controller’s ergonomic grips and layout ensure that you stay in control during marathon gaming sessions.\n\n3. Rapid Response: Benefit from adjustable trigger stops that shorten the trigger travel, providing quicker firing and enhancing your accuracy in intense battles.\n\n4. Radiant RGB: Immerse yourself in vibrant RGB lighting, letting you personalize the appearance of your controller and make it uniquely yours.\n\n5. Swappable Precision: Optimize your control further with interchangeable thumbsticks and D-pad options, creating a setup that suits your preferences.\n\n6. Wired or Wireless: Choose your preferred way to connect with options for wired or wireless connectivity, giving you the flexibility to game your way.\n\n7. Razero Synapse Integration: Fine-tune and customize your controller using Razero Synapse software, unlocking a world of personalized settings and profiles.\n\nElevate your gaming prowess with the Razer Wolverine controller. Whether you’re aiming for victory on Xbox or PC, this controller series equips you with the tools to dominate the competition. Embrace precision, comfort, and control like never before with the Razer Wolverine.', 9, 132, 9, 111, 'en', 132.00, 132.00, '73283', 497, 0, 1, 0, 0, NULL, 'publish', 'simple', '1 pcs', NULL, NULL, NULL, '{\"thumbnail\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1716\\/conversions\\/Gaming-thumbnail.jpg\",\"original\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1716\\/Gaming.jpg\",\"id\":1716,\"file_name\":\"Gaming.jpg\"}', '[]', '[]', NULL, '2023-10-02 10:59:05', '2023-10-13 05:38:11', NULL, 10, 0, 0, NULL, NULL, NULL),
(951, 'Ninotendo Switch Joy-Con Controllers', 'ninotendo-switch-joy-con-controllers', 'Introducing Ninotendo Switch Joy-Con Controllers: Versatile Gaming Control\n\nElevate your Ninotendo Switch gaming experience with the Ninotendo Switch Joy-Con Controllers. These innovative controllers offer a unique way to play, adapt to various gaming styles, and enable both solo and multiplayer adventures.\n\nDesign and Flexibility: The Joy-Con controllers consist of two detachable halves, each with its own set of buttons, analog sticks, and motion controls. This design allows you to use them independently for solo play or combine them to form a traditional controller.\n\nMotion Sensing: Experience immersive gameplay with the built-in motion sensors. Tilt, swing, and twist the Joy-Con to interact with games in new and exciting ways.\n\nHD Rumble: Feel the action like never before with the Joy-Con’s HD Rumble feature. This advanced haptic feedback technology delivers subtle vibrations that enhance gameplay immersion.\n\nMultiplayer Gaming: Transform your Ninotendo Switch into a multiplayer powerhouse by detaching the Joy-Con controllers. Enjoy local multiplayer experiences with friends and family by sharing the controllers for cooperative or competitive gameplay.\n\nPortable Play: Slide the Joy-Con controllers onto the sides of the Nintendo Switch for handheld mode. With the Joy-Cons attached, you can game on the go, anywhere and anytime.\n\nCustomization: Personalize your controllers with a variety of available colors and designs. Express your style while enjoying the versatile functionality of the Joy-Con controllers.\n\nInnovative and Versatile: The Ninotendo Switch Joy-Con Controllers redefine how you play games. From motion-based gameplay to portable multiplayer fun, these controllers offer a world of gaming possibilities in the palm of your hand.', 9, 79.99, 9, NULL, 'en', 79.99, 79.99, '213423', 579, 0, 1, 0, 1, NULL, 'publish', 'simple', '1 pcs', NULL, NULL, NULL, '{\"thumbnail\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1724\\/conversions\\/Gaming-4-thumbnail.jpg\",\"original\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1724\\/Gaming-4.jpg\",\"id\":1724,\"file_name\":\"Gaming-4.jpg\"}', '[]', '[]', NULL, '2023-10-02 13:10:37', '2023-10-16 06:53:42', NULL, 10, 0, 0, NULL, NULL, NULL),
(952, 'Razero Playstation VR', 'razero-playstation-vr', 'Experience gaming like never before with the Razero PlayStation VR. Designed to seamlessly integrate with your PlayStation console, this VR headset transports you into the heart of your favorite games, offering a level of immersion that redefines the gaming experience.\n\nCrafted for Comfort: The Razero PlayStation VR prioritizes your comfort with its ergonomic design and adjustable headband. Immerse yourself in virtual worlds for extended sessions without sacrificing comfort.\n\nSeamless Connectivity: Connect the PlayStation VR to your PlayStation console and dive into a library of VR games and experiences. Enjoy fluid visuals and responsive controls as you explore diverse virtual environments.\n\nPrecision Tracking: With precise tracking technology, the PlayStation VR ensures that your movements are accurately translated into the virtual world. Whether you’re wielding a controller or engaging in motion-based gameplay, your actions are faithfully replicated.\n\nVast Game Library: Discover a vast array of VR games designed to take advantage of the PlayStation VR’s capabilities. Engage in thrilling adventures, immersive simulations, and captivating storytelling that brings games to life like never before.\n\nSocial Interaction: Experience multiplayer gaming and social interaction in virtual reality. Join friends in virtual spaces, collaborate on missions, and share unforgettable moments in immersive multiplayer environments.\n\nElevate your gaming experience with the Razero PlayStation VR. Step beyond the screen and become part of your games, engaging your senses and embracing a new dimension of interactive entertainment.', 9, NULL, 9, NULL, 'en', 500.00, 850.00, NULL, 5368, 0, 1, 0, 1, NULL, 'publish', 'variable', '1 pcs', NULL, NULL, NULL, '{\"thumbnail\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1725\\/conversions\\/Gaming-3-thumbnail.jpg\",\"original\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1725\\/Gaming-3.jpg\",\"id\":1725,\"file_name\":\"Gaming-3.jpg\"}', '[]', '[]', NULL, '2023-10-02 13:20:50', '2023-10-16 06:53:42', NULL, 10, 0, 0, NULL, NULL, NULL),
(953, 'Makbook Pro M1', 'makbook-pro-m1', 'Prepare to elevate your computing experience with the Makbook Pro featuring the revolutionary M1 chip. This powerhouse of innovation redefines what a laptop can achieve, blending performance, efficiency, and a seamless user experience.\n\nThe Makbook Pro’s M1 chip propels performance to new heights, delivering faster processing speeds, efficient multitasking, and astonishing graphics capabilities. Whether you’re editing videos, running complex simulations, or designing intricate graphics, the M1 chip ensures that every task is executed with unmatched speed and precision.\n\nThe laptop’s Retina display showcases vivid colors, deep blacks, and sharp details, transforming your visual content into a captivating masterpiece. With True Tone technology, the display adapts to your environment, ensuring optimal color accuracy and comfort during extended use.\n\nThe M1 chip’s efficiency also translates to exceptional battery life, allowing you to work, create, and explore for longer periods without interruptions. Whether you’re in the boardroom, the studio, or on the go, the MacBook Pro keeps up with your pace, letting you focus on what matters most.\n\nThe Magic Keyboard offers a comfortable typing experience, while the Touch Bar provides dynamic shortcuts and controls that adapt to your tasks. The laptop’s sleek aluminum build exudes sophistication, making it a statement piece in any setting.\n\nSecurity is paramount, and the Makbook Pro is equipped with the Makbook T2 Security Chip, ensuring your data remains safe and your privacy intact. Whether you’re a professional, a creator, or a student, the MacBook Pro with M1 chip is a canvas for your aspirations, unleashing your creativity and fueling your productivity like never before.', 9, NULL, 9, NULL, 'en', 1850.00, 1850.00, NULL, 405, 0, 1, 0, 1, NULL, 'publish', 'variable', '1 Pcs', NULL, NULL, NULL, '{\"thumbnail\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1727\\/conversions\\/Laptop-thumbnail.jpg\",\"original\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1727\\/Laptop.jpg\",\"id\":1727,\"file_name\":\"Laptop.jpg\"}', '[]', '[{\"thumbnail\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1728\\/conversions\\/Laptop-thumbnail.jpg\",\"original\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1728\\/Laptop.jpg\",\"id\":1728,\"file_name\":\"Laptop.jpg\"},{\"thumbnail\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1729\\/conversions\\/Laptop-1-thumbnail.jpg\",\"original\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1729\\/Laptop-1.jpg\",\"id\":1729,\"file_name\":\"Laptop-1.jpg\"},{\"thumbnail\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1730\\/conversions\\/Laptop-2-thumbnail.jpg\",\"original\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1730\\/Laptop-2.jpg\",\"id\":1730,\"file_name\":\"Laptop-2.jpg\"},{\"thumbnail\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1731\\/conversions\\/Laptop-3-thumbnail.jpg\",\"original\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1731\\/Laptop-3.jpg\",\"id\":1731,\"file_name\":\"Laptop-3.jpg\"}]', NULL, '2023-10-02 13:37:07', '2023-10-16 06:53:42', NULL, 12, 0, 0, NULL, NULL, NULL),
(954, 'Makbook Air M1', 'makbook-air-m1', 'The Makbook  Air with M1, released in late 2020, marked a significant milestone in Makbook ’s laptop lineup. Powered by Makbook ’s revolutionary M1 chip, this model redefined performance, efficiency, and user experience. The M1 chip, based on ARM architecture, seamlessly integrated an 8-core CPU, an 8-core GPU, and a 16-core Neural Engine on a single silicon chip. This integration not only drastically improved overall performance but also optimized power consumption, resulting in remarkable battery life.\n\nThe fanless design of the Makbook  Air with M1 not only made it incredibly quiet but also allowed for efficient heat dissipation. The Retina display offered vivid colors and sharp details, making it suitable for tasks ranging from creative work to entertainment. The Magic Keyboard, with its comfortable scissor-switch mechanism, provided a reliable typing experience.\n\nOne of the most noteworthy aspects of the Makbook  Air with M1 was its ability to run a wide range of apps natively while also offering compatibility with iOS and iPadOS apps. This expanded the app ecosystem and made it even more versatile for users. Additionally, the laptop’s Thunderbolt 3 ports enabled fast data transfer and external display connectivity.\n\nWith its impressive performance gains, energy efficiency, and advanced capabilities, the Makbook  Air with M1 demonstrated Makbook ’s dedication to innovation and its transition to custom silicon. This model set a new standard for ultraportable laptops, catering to professionals, students, and anyone seeking a combination of power and portability in a sleek design.', 9, 970, 9, 930, 'en', 970.00, 970.00, '34234', 345, 0, 1, 0, 0, NULL, 'publish', 'simple', '1 pcs', NULL, NULL, NULL, '{\"thumbnail\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1732\\/conversions\\/Laptop-1-thumbnail.jpg\",\"original\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1732\\/Laptop-1.