(955, 'Makbook Air 2019', 'makbook-air-2019', 'The Makbook Air model released in 2019 represented a refinement of the Makbook ultra-portable laptop line. Here are some key details about this model:\n\nRelease Date: The Makbook Air 2019 was released in July 2019.\nDesign: The 2019 Makbook Air retained the iconic slim and lightweight design that the Air line is known for. It featured an aluminum unibody construction, providing durability and a premium feel.\nDisplay: The laptop featured a 13.3-inch Retina display with a resolution of 2560 x 1600 pixels. The Retina display provided sharper text and more vibrant colors compared to previous non-Retina models.\nProcessor: The Makbook Air 2019 was powered by an Intel dual-core 8th-generation processor. The base model featured a 1.6GHz dual-core Intel Core i5 processor, which could be configured to a faster processor.\nRAM: The base model came with 8GB of RAM, which was the standard memory configuration at the time. It could be upgraded to 16GB for better multitasking performance.\nStorage: The base storage option was a 128GB SSD, with the option to upgrade to larger capacities like 256GB, 512GB, or even 1TB.\nKeyboard: Unlike the earlier butterfly keyboard, the 2019 MacBook Air featured a Makbook improved scissor-switch keyboard, offering a more reliable and comfortable typing experience.\nPorts: The laptop featured two Thunderbolt 3 (USB-C) ports, which could be used for charging, data transfer, and connecting external displays.\nBattery Life: Makbook claimed up to 12 hours of battery life for web browsing and up to 13 hours of iiTunes movie playback.\nTouch ID: The Makbook Air 2019 included Touch ID, a fingerprint sensor integrated into the power button, providing enhanced security and convenience for unlocking the laptop and making secure payments.\nOverall, the Makbook Air 2019 aimed to provide a balance between portability, performance, and features, making it suitable for a wide range of users including students, professionals, and general consumers.', 9, 790, 9, 710, 'en', 790.00, 790.00, '23433', 453, 0, 1, 0, 0, NULL, 'publish', 'simple', '1 pcs', NULL, NULL, NULL, '{\"thumbnail\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1741\\/conversions\\/Laptop-5-thumbnail.jpg\",\"original\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1741\\/Laptop-5.jpg\",\"id\":1741,\"file_name\":\"Laptop-5.jpg\"}', '[]', '[{\"thumbnail\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1779\\/conversions\\/Laptop-5-thumbnail.jpg\",\"original\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1779\\/Laptop-5.jpg\",\"id\":1779,\"file_name\":\"Laptop-5.jpg\"},{\"thumbnail\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1780\\/conversions\\/Laptop-2-thumbnail.jpg\",\"original\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1780\\/Laptop-2.jpg\",\"id\":1780,\"file_name\":\"Laptop-2.jpg\"},{\"thumbnail\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1781\\/conversions\\/Laptop-3-thumbnail.jpg\",\"original\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1781\\/Laptop-3.jpg\",\"id\":1781,\"file_name\":\"Laptop-3.jpg\"},{\"thumbnail\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1782\\/conversions\\/Laptop-4-thumbnail.jpg\",\"original\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1782\\/Laptop-4.jpg\",\"id\":1782,\"file_name\":\"Laptop-4.jpg\"}]', NULL, '2023-10-02 13:42:13', '2023-10-12 17:06:12', NULL, 12, 0, 0, NULL, NULL, NULL),
(957, 'Azsus VivoBook Pro 15', 'azsus-vivobook-pro-15-ggw', 'Introducing the Azsus VivoBook Pro 15: Unleash Your Creative Power\n\nMeet the Azsus VivoBook Pro 15, a powerhouse of creativity and performance that redefines what a laptop can achieve. Designed to cater to the needs of professionals and creative enthusiasts alike, this laptop combines stunning visuals, robust processing, and thoughtful design.\n\nThe Vivo Book Pro 15 boasts a vibrant 4K UHD display that brings your visual projects to life with incredible clarity and color accuracy. Whether you’re editing photos, creating videos, or designing graphics, the immersive display ensures that every detail is captured with precision.\n\nUnder the hood, the laptop is fueled by powerful Intel Core processors and dedicated NVIDIA GeForce graphics, making resource-intensive tasks a breeze. The combination of ample RAM and fast storage options ensures smooth multitasking and lightning-fast data access, enhancing your productivity.\n\nThe backlit keyboard not only adds a touch of sophistication but also allows for comfortable typing in any lighting condition. The laptop’s sleek aluminum chassis exudes premium craftsmanship, making it a device that stands out both in the boardroom and the creative studio.\n\nWith comprehensive connectivity options, including USB-C and HDMI ports, the VivoBook Pro 15 ensures that you’re ready to connect to various devices and peripherals. The laptop also offers advanced security features, such as a fingerprint sensor for quick and secure logins.\n\nThe Azsus VivoBook Pro 15 is not just a laptop; it’s a canvas for your imagination, a tool for your ambitions, and a partner in your journey to greatness. Whether you’re a content creator, designer, or professional, this laptop empowers you to turn your ideas into reality with unrivaled performance and precision.', 9, 750, 9, NULL, 'en', 750.00, 750.00, '23124', 451, 0, 1, 0, 1, NULL, 'publish', 'simple', '1 pcs', NULL, NULL, NULL, '{\"thumbn