(975, 'SafetyGuard Pro First Aid Kit', 'safetyguard-pro-first-aid-kit', 'The SafetyGuard Pro First Aid Kit is your comprehensive and dependable solution for addressing minor injuries and emergencies at home, in the car, at the office, or during outdoor adventures. This thoughtfully designed kit is packed with a wide range of medical supplies and tools, making it your first line of defense in times of need.\n\nInside the rugged and compact carrying case, you\'ll find an extensive selection of supplies, including adhesive bandages, gauze pads, antiseptic wipes, tweezers, scissors, a CPR face shield, adhesive tape, and more. It also includes essential items like instant cold packs, disposable gloves, and a thermal blanket to ensure you\'re prepared for various situations.\n\nThe SafetyGuard Pro First Aid Kit is organized and labeled for easy access, allowing you to quickly locate the items you need in critical moments. Whether you\'re dealing with minor cuts, scrapes, burns, or insect bites, this kit has you covered. Its portable design makes it convenient for on-the-go use, ensuring that you can provide immediate assistance whenever and wherever it\'s needed.\n\nSafety and well-being are paramount, and the SafetyGuard Pro First Aid Kit empowers you to take control of any unexpected situation. Whether you\'re a parent, an outdoor enthusiast, or simply want peace of mind, this comprehensive first aid kit is your trusted companion in promoting safety and providing essential care when it matters most.', 11, 89, 11, 69, 'en', 89.00, 89.00, '123445', 534, 0, 1, 0, 0, NULL, 'publish', 'simple', '1 pcs', NULL, NULL, NULL, '{\"thumbnail\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1869\\/conversions\\/medicine-%26-first-aid-6-thumbnail.jpg\",\"original\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/1869\\/medicine-%26-first-aid-6.jpg\",\"id\":1869,\"file_name\":\"medicine-%26-first-aid-6.jpg\"}', '[]', '[{\"thumbnail\":\"https:\\/\\/pi