(1050, 'ContraCare X', 'contracare-x', 'Tablet is a hormonal contraception, an effective contraceptive tablet widely used by women to avoid unwanted pregnancy\nAbout ContraCare X, 1 Tablet\nContraCare X, 1 Tablet is a female hormone called progestin (a form of progesterone) used to prevent unintended pregnancy and hormone therapy. ContraCare X, 1 Tablet is used as a single agent in emergency contraception, and as a hormonal contraceptive released from an intrauterine device (IUD).  ContraCare X, 1 Tablet is the most commonly used emergency contraceptive. Unintended pregnancy is a pregnancy that occurred either unwanted when no children or no more children were desired. Also, pregnancy is mistimed, such as the pregnancy occurred earlier than desired.\nContraCare X, 1 Tablet contains ‘Levonorgestrel’, which prevents the release of an egg from the ovary (female reproductive cells) or prevents fertilization of an egg by sperm (male reproductive cells). ContraCare X, 1 Tablet may also change the lining of the uterus to prevent the development of a pregnancy. ContraCare X, 1 Tablet does not have any effect if you are already pregnant hence does not cause abortion.\nContraCare X, 1 Tablet should be taken preferably within 12 hours and not later than 72 hours (3 days) of having unprotected sex or contraceptive failure. In some cases, you may experience nausea, vomiting, lower abdominal pain, tiredness, headache, diarrhoea, dizziness and uterine bleeding. Most of these side effects of ContraCare X, 1 Tablet subside with time. However, if the side effects are persistent, reach out to your doctor.\nDo not take ContraCare X, 1 Tablet, if are allergic to ContraCare X, 1 Tablet or any of the ingredients. Do not take ContraCare X, 1 Tablet if you are already pregnant, ContraCare X, 1 Tablet cannot terminate the pregnancy. Please consult your doctor before taking ContraCare X, 1 Tablet, if you are a breastfeeding mother as it may pass through the milk to the baby. Do not use ContraCare X, 1 Tablet if you have heart fitted with an artificial valve, have heart diseases like high blood pressure or high blood cholesterol levels (increased fat in your blood), have asthma, have blood clot problems, have a bleeding disorder, have liver or kidney disease, have anaemia (low haemoglobin), salpingitis (inflammation of the fallopian tubes) or otherwise malnourished. ContraCare X, 1 Tablet is known to cause sleepiness, so driving or operating machinery should not be done. St John’s Wort (a natural remedy used to treat mild depression) should not be taken when taking ContraCare X, 1 Tablet as it is known to interact.\nUses of ContraCare X, 1 Tablet\nEmergency contraception\nMedicinal Benefits\nContraCare X, 1 Tablet contains ‘Levonorgestrel’ is a progestin (female hormones) used for emergency contraception within 12 hours and not later than 72 hours (3 days) of having unprotected sex or contraceptive failure. It works by preventing the release of an egg from the ovary (female reproductive cells) or preventing fertilization of an egg by sperm (male reproductive cells). ContraCare X, 1 Tablet may also change the lining of the uterus to prevent the development of a pregnancy. ContraCare X, 1 Tablet does not have any effect if you are already pregnant hence does not cause abortion.\nDirections for Use\nContraCare X, 1 Tablet should be taken in dose and duration as recommended by your doctor. Take ContraCare X, 1 Tablet with a meal to avoid stomach upset. Swallow it as a whole with a glass of water. Do not chew, crush or break it.\nSafety Information\n•	Keep in a cool and dry place, away from sunlight\n•	Keep out of reach of children\nStorage\nStore in a cool and dry place away from sunlight\nKey Ingredients\nLevonorgestrel.\nSide Effects of ContraCare X, 1 Tablet\n•	Nausea\n•	Vomiting\n•	Lower abdominal pain\n•	Tiredness\n•	Headache\n•	Diarrhea\n•	Dizziness\n•	Uterine bleeding\nIn-Depth Precautions and Warning\nDrug Warnings\nDo not take ContraCare X, 1 Tablet, if are allergic to ContraCare X, 1 Tablet or any of the ingredients, have a heart fitted with an artificial valve, have heart diseases like high blood pressure or high blood cholesterol levels (increased fat in your blood), have asthma, have blood clot problems, have a bleeding disorder, have liver or kidney disease, have anemia (low haemoglobin), salpingitis (inflammation of the Fallopian tubes) or otherwise malnourished. Taking ContraCare X, 1 Tablet in these conditions can cause life-threatening conditions in an individual. ContraCare X, 1 Tablet is known to cause sleepiness, so driving or operating machinery should not be done. ContraCare X, 1 Tablet can only prevent you from becoming pregnant if you take it within 72 hours of unprotected sex. If you are already pregnant, ContraCare X, 1 Tablet cannot terminate the pregnancy, so it is not an abortion pill. St John’s Wort (a natural remedy used to treat mild depression) should not be taken when taking ContraCare X, 1 Tablet as it is known to interact. Use caution while driving a motor vehicle, as dizziness or drowsiness may occur. Let your doctor know if you are a breastfeeding mother. Your doctor will weigh the benefits and any potential risks before recommending it. You should not take ContraCare X, 1 Tablet without a doctor’s advice. ContraCare X, 1 Tablet is not recommended for children younger than 16 years old. ContraCare X, 1 Tablet is not intended for use in the first trimester of pregnancy.\nDrug Interactions\nDrug-Drug interaction: ContraCare X, 1 Tablet interacts with anti-epilepsy medicines (primidone, phenytoin, carbamazepine), medicines used to treat tuberculosis (rifampicin, rifabutin), medicines used to treat HIV (ritonavir, efavirenz) medicine used to treat fungal infections (griseofulvin, ketoconazole, itraconazole, posaconazole).\nDrug-Food Interaction: ContraCare X, 1 Tablet interacts with St. John’s wort (an antidepressant herbal supplement).\nDrug-Disease Interaction: ContraCare X, 1 Tablet should be taken with caution in people who have a bleeding problem, confirmed or suspected ectopic pregnancy, heart problem, liver or kidney disease, vaginal bleeding, porphyria (an inherited blood disease that may cause nervous system or skin problems).\nDrug-Drug Interactions Checker List:\n•	PRIMIDONE\n•	PHENYTOIN\n•	EFAVIRENZ\n•	RITONAVIR\n•	CARBAMAZEPINE\n•	GRISEOFULVIN\n•	KETOCONAZOLE\n•	ITRACONAZOLE', 11, 2.5, 11, NULL, 'en', 2.50, 2.50, '58636386', 266, 0, 1, 0, 0, NULL, 'publish', 'simple', '1 pcs', NULL, NULL, NULL, '{\"thumbnail\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/2252\\/conversions\\/Contraceptive-1-thumbnail.jpg\",\"original\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/2252\\/Contraceptive-1.jpg\",\"id\":2255,\"file_name\":\"Contraceptive-1.jpg\"}', '[]', '[{\"thumbnail\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/2253\\/conversions\\/Contraceptive-thumbnail.jpg\",\"original\":\"https:\\/\\/pickbazarlaravel.s3.ap-southeast-1.amazonaws.com\\/2253\\/Contraceptive.jpg\",\"id\":2256,\"file_name\":\"Contraceptive.jpg\"}]', NULL, '2023-10-11 18:29:46', '2023-10-11 18:29:46', NULL, 19, 0, 0, NULL, NULL, NULL),
